import React, { Component } from 'react'

export default class CsvPanel extends Component {
  render() {
    return (
        <div>

          <label htmlFor="picker1">CSV file for service courses and time slots:</label>
          <input type="file" accept=".csv" id="picker1" />
          <label htmlFor="picker2">CSV file for classrooms and capacities:</label>
          <input type="file" accept=".csv" id="picker2" />
          <label htmlFor="picker3">CSV file for courses and course details:</label>
          <input type="file" accept=".csv" id="picker3" />
          <label htmlFor="picker4">CSV file for instructors and busy times:</label>
          <input type="file" accept=".csv" id="picker4" />
      </div>
    )
  }
}
